import React from 'react';
import { Box, Paper, Button } from '@mui/material';

export default function Traffic() {
   const divStyling = {
      marginBottom: '1.2rem',
   }

   return (
      <Box sx={{
         margin: 4,
      }}>
         <Paper sx={{
            padding: 4,
            boxShadow: 10,
            backgroundColor: '#fff',
         }}>
            <div style={divStyling}>Please see Chad Smith's excellent Tahoe road conditions website here: <Button variant="outlined" href="https://tahoeroads.info/" target='_blank' rel='noopener noreferrer'>
               Check road conditions
            </Button></div>


            <ul> <h3>Three main roads into Tahoe from SF Bay Area:</h3>
               <li>Highway 88 --> Goes to Kirkwood </li>
               <li>Highway 50 --> Goes to Sierra at Tahoe and Heavenly </li>
               <li>Highway 80 --> Goes to north shore Tahoe resorts (Sugar Bowl, Northstar, Palisades, Boreal)</li>
            </ul>
         </Paper>
      </Box>
   )
};
